import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Comment from './Comment'
const Comments = (props) => {
    return (
        <div>
            <Router>
            <Route path='/hello' exact render={(useless) => {
                return(
                    <p>helo</p>
                )
            }} />
            {props.comments.map((comment) => {
                return (
                    <div>
                        <Comment
                            key={comment[0].id}
                            comment={comment}
                            userId={props.userId}
                        />
                    </div>
                );
            })}
            </Router>
        </div>
    );
};
export default Comments;
